import { createRoutes, Route, Link } from 'react-router-dom';

import "./App.css";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Home from "./pages/Home";
import Destinations from "./pages/Destinations";
import About from "./pages/About";
import Login from "./pages/Login";
import Skardu from "./pages/Skardu";
import Swat from "./pages/Swat";
import Gilgit from "./pages/Gilgit";

const routes = [
  {
    path: '/',
    element: <Home />
  },
  {
    path: '/menu',
    element: <Destinations />
  },
  {
    path: '/about',
    element: <About />
  },
  {
    path: '/login',
    element: <Login />
  },
  {
    path: '/destinations/swat',
    element: <Swat />
  },
  {
    path: '/destinations/skardu',
    element: <Skardu />
  },
  {
    path: '/destinations/gilgit',
    element: <Gilgit />
  }
];

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Routes>
          {routes.map(route => (
            <Route key={route.path} path={route.path} element={route.element} />
          ))}
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
